\begin{equation*}
		\mathcal{L}_{i,\textup{c}}(\widetilde{y}) \triangleq
		\frac{\mathcal{N}(b_i; 0, R)}
		{\mathcal{N}\left(\frac{b_i' R^{-1} a_i}{\sqrt{a_i' R^{-1} a_i}}; 0, 1 \right)}
		\frac{\Delta \Phi(a_i, b_i; R)}{\sqrt{a_i' R^{-1} a_i}}
	\end{equation*}

\begin{equation*}
	\Delta \Phi(a, b; R) \triangleq
	\Phi\left( \frac{a' R^{-1} a + b' R^{-1} a}{\sqrt{a' R^{-1} a}} \right) -
	\Phi\left( \frac{b' R^{-1} a}{\sqrt{a' R^{-1} a}} \right).
\end{equation*}

